TABLIST_INFO:
  ENABLED: true
  PING: -1
  HEADER: []
  FOOTER: []
  REPLACE_KOTH_ACTIVE: true
  REPLACE_SCHEDULE_NAME: '%color%%koth% &7(%world%)'
  REPLACE_SCHEDULE_TIME: '%time%'

HEADER_CONFIG:
  CHANGER_TICKS: 200
  CHANGES:
    - '<p>&lCyrusPvP &7┃ &f%online%&7/&f%max-online%'
    - '<s>&lCyrusPvP &7┃ &f%online%&7/&f%max-online%'

FOOTER_CONFIG:
  CHANGER_TICKS: 200
  CHANGES:
    - '<e>store.cyruspvp.net'
    - '<s>discord.gg/cyruspvp'

TEAM_FORMAT:
  MEMBER_FORMAT: '&a%role%%player%'
  MEMBER_SHOW_SKIN: true # Next to member name show skins
  CHANGE_TEAM_SKIN: true
  CHANGE_CLAIM_SKIN: true
  CLAIM_SKIN_CHANGE:
