  LIST_FORMAT: # It uses the sorting of /f sort
    DTR: '&r%team-name% &8[%dtr-color%%dtr%%dtr-symbol%&8]'
    ONLINE: '&r%team-name% &8[&a%team-online%&7/&a%team-max-online%&8]'
  NO_TEAM:
    - '&cCreate a team'
    - '&cNone'
    - '&c/team create'
  IN_TEAM: # You can use %team-balance%, %team-online%  or %team-maxonline% too
    - '&fDTR: %team-dtr-color%%team-dtr%%team-dtr-symbol%'
    - '&fHQ: <p>%team-hq%'
    - '&fOnline: <p>%team-online%&7/<p>%team-maxonline%'

